import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {  Route, Routes } from 'react-router-dom';
import Home from './Home';
import About from './About';
import NavBar from './components/NavBar';
import Footer from './components/Footer';
import Sign from "./Sign"
import Signin from "./SignIn"
import "./index.css";
import Learnings from "./MyLearnings"
import Development from "./Developments"
import Personal from "./Personal .js"
import Details from './DetailsPage.js';
//stareted here
const express = require('express');
const connectDB = require('../backend/src/config/db.js');
const app = express();
// backend/src/app.js
const cors = require('cors');
app.use(cors({ origin: 'http://localhost:3000' })); // Replace with your frontend URL

connectDB();
app.use(express.json({ extended: false }));
app.use('/api/users', require('../backend/src/routes/userRoutes.js'));
//end here
module.exports = app;
function App() {
  return (
    <>
      <NavBar />

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/sign" element={<Sign />} />
        <Route path="/signin" element={<Signin />} />
        <Route path="/learnings" element={<Learnings />} />
        <Route path="/development" element={<Development />} />
        <Route path="/personal" element={<Personal />} />
        <Route path="/details" element={<Details />} />
      </Routes>

      <Footer />
    </>
  );
}

export default App;
